import { Container, Typography, Box, makeStyles } from "@material-ui/core";
import React from "react";
import "../styles/components/Footer.css";

const useStyles = makeStyles((theme) => ({
  root: {
    backgroundColor: theme.palette.primary,
  },
  MuiTypography: {
    color: theme.palette.text.primary,
  },
}));

const Footer = () => {
  const classes = useStyles();
  return (
    <Box className={classes.root}>
      <Container maxWidth="lg">
        <Typography variant="subtitle1">
          This is a project build by Raynulfo Mata
        </Typography>
        <Typography variant="subtitle1">Build on May 2021</Typography>
        <Typography variant="subtitle1">All Rights reserved. LOL</Typography>
      </Container>
    </Box>
  );
};

export default Footer;
